import React from 'react';

const FooterContact = ()=> (
<div className='icons'>
        <ul>
            <li><a href="https://twitter.com/posepablo?lang=es " class="twitter"><span class="icon">  <img src='./twitter-brands.svg' alt="twitter" /></span></a></li>
            <li><a href="https://www.facebook.com/pablo.poseiglesias.1 " class="icon brands fa-facebook-f "><span class="label ">Facebook</span></a></li>
            <li><a href="https://www.instagram.com/pablopose_/?hl=es " class="icon brands fa-instagram "><span class="label ">Instagram</span></a></li> 
        </ul>
</div>
) 

export default FooterContact;
